function Reference() {
    return (
      <div className="Reference">
        <div className="d-flex flex-column justify-content-start align-items-start">
            <ul className="list-group list-group-flush text-start text-break ">
                <li className="list-group-item">6 actions to fight climate change. (n.d.). https://www.activesustainability.com/climate-change/6-actions-to-fight-climate-change/#:~:text=%2D%20Eat%20food%20that%20is%20local,foods%20as%20much%20as%20possible.</li>
                <li className="list-group-item">3 Ways to Save the Earth. (2020, September 16). The Nature Conservancy. https://www.nature.org/en-us/about-us/who-we-are/our-science/three-ways-to-save-our-planet/</li>
                <li className="list-group-item">Earth.Org. (2022). 10 Inspirational Quotes from Celebrities on Protecting the Environment | Earth.Org. Earth.Org. https://earth.org/inspirational-quotes-from-celebrities-on-environment/#:~:text=%E2%80%9CClimate%20change%20is%20the%20greatest,Mark%20Ruffalo%2C%20actor%20and%20activist.</li>
                <li className="list-group-item">https://history-computer.com/wp-content/uploads/2022/12/shutterstock_2127217418-2048x1303.jpg</li>
                <li className="list-group-item">https://www.bca.co.id/-/media/Feature/News/Edukatips/2022/10/20221010-Tips-Menghemat-Listrik-Desktop.jpg?v=1</li>
                <li className="list-group-item">https://sustainabletravel.org/wp-content/uploads/Blog-Image-Planting-Tree-Seedling.jpg</li>
                <li className="list-group-item">https://pngtree.com/freepng/save-the-world-globe-and-hands-doodle-earth-icon-hand-drawn-on-white-background_5009285.html</li>
                <li className="list-group-item">https://sphera.com/wp-content/uploads/2022/08/gettyimages-586087414-2048x2048-smaller-scaled.jpg</li>
            </ul>
        </div>
      </div>
    );
  }
  
export default Reference;
